cial workers.',NULL,NULL),(10,1,'2020-05-27 20:23:20','2020-05-27 20:25:07',NULL,'Test Person3',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'test-person3',NULL,NULL,NULL,NULL,NULL,_binary 'Thank you to all the people who are frontline and essential workers and are putting themselves in danger for our safety.',NULL,NULL),(11,1,'2020-05-27 20:23:36','2020-05-27 20:25:22',NULL,'Test Person4',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'test-person4',NULL,NULL,NULL,NULL,NULL,_binary 'Thank You to all our teachers and school administrators who are working very hard to keep our school running during this pandemic.',NULL,NULL),(12,1,'2020-05-27 20:23:43','2020-05-27 20:25:45',NULL,'Test Person5',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'test-person5',NULL,NULL,NULL,NULL,NULL,_binary 'Thank You to our healthcare workers and delivery workers. Eva and Ab',NULL,NULL),(13,1,'2020-05-27 20:23:50','2020-05-27 20:26:00',NULL,'Test Person6',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'test-person6',NULL,NULL,NULL,NULL,NULL,_binary 'Thank You to SOMA sewing volunteers for providing 20,000 masks to front line workers, shelters and to others in need. Thank you to our service men and women who have lost their lives for our country. Thank you to businesses that retained their employees during this crisis. Cami and Mat',NULL,NULL),(14,1,'2020-05-27 20:24:08','2020-05-27 20:27:30',NULL,'Test Person7',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'test-person7',NULL,NULL,NULL,NULL,NULL,_binary 'Thank You from Our Family to Yours this Memorial Day! Thank you to our past and present Hero Families that keep our communities safe and well. We are grateful for the families of our brave and selfless military, our firefighters and police officers, the healthcare workers, and our social service workers. You are our American Heroes! The Gaspar Family',NULL,NULL),(15,1,'2020-05-27 20:24:15','2020-05-27 20:27:48',NULL,'Test Person8',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'test-person8',NULL,NULL,NULL,NULL,NULL,_binary 'Thank You to all the Nurturers and Gardeners. Thank You to all our doctors and nurses who nurture us with their sacrifice, care and compassion. Thank You to the teachers, grandparents, and parents who grow and plant seeds of hope and compassion in our children. Thank You to our global scientists who work together to find solutions. Thank You to New York where everyone can find community. We don’t make it here alone. We make it here together.',NULL,NULL),(464,1,'2020-05-30 18:02:40','2020-06-02 11:53:35',NULL,'Projects',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'projects',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(465,1,'2020-05-30 18:02:52','2020-06-03 11:56:22',NULL,'.home',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'home',NULL,NULL,NULL,NULL,NULL,_binary 'United in Gratitude to our Frontline Workers and Communities',NULL,NULL),(466,1,'2020-05-30 18:03:28','2020-06-01 01:37:52',NULL,'Thank-You Masks',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'thank-you-masks',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(467,1,'2020-05-27 20:19:30','2020-05-30 18:20:37',1,'live',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'live',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(468,1,'2020-05-27 20:19:44','2020-05-30 18:20:47',10,'pending',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'pending',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(469,1,'2020-06-02 11:50:36','2020-06-03 12:07:36',NULL,'Submission',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'submission',NULL,NULL,NULL,NULL,NULL,NULL,_binary '<div>Please tell us who you are if you would like us to keep you updated on this and future initiatives. We will not Post your name or contact info on your submission.</div><div><br></div><div>Do tell us where you are from as we would like to post this.</div>',_binary '<br>'),(470,1,'2020-06-02 23:04:45','2020-06-02 23:04:45',NULL,'Wei-Hao Wang',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'wei-hao-wang',NULL,'1969-12-31 19:00:00',NULL,NULL,NULL,_binary 'jojo',_b